#include <Arduino.h>
#include <TensorFlowLite.h>
#include <Arduino_APDS9960.h>
#include "model.h"

// TensorFlow Lite Micro headers
#include "tensorflow/lite/micro/all_ops_resolver.h"
#include "tensorflow/lite/micro/micro_error_reporter.h"
#include "tensorflow/lite/micro/micro_interpreter.h"
#include "tensorflow/lite/schema/schema_generated.h"
#include "tensorflow/lite/version.h"

// Application constants
static const int kBaudRate = 9600;
static const uint32_t kInferenceIntervalMs = 200;
static const size_t kTensorArenaSize = 12288;

// Labels and Emojis (UTF-8)
static const char* kClassLabels[3] = {"Apple", "Banana", "Orange"};
static const char* kClassEmojis[3] = {"🍎", "🍌", "🍊"};

// TFLM globals
namespace {
  tflite::MicroErrorReporter micro_error_reporter;
  tflite::ErrorReporter* error_reporter = &micro_error_reporter;

  const tflite::Model* tfl_model = nullptr;
  tflite::AllOpsResolver resolver;
  tflite::MicroInterpreter* interpreter = nullptr;

  alignas(16) static uint8_t tensor_arena[kTensorArenaSize];
  TfLiteTensor* input = nullptr;
  TfLiteTensor* output = nullptr;
}

// Utility: Halt with message
static void Halt(const char* msg) {
  Serial.println(msg);
  while (true) {
    delay(1000);
  }
}

// Utility: Count elements in tensor dims
static int ElementCount(const TfLiteIntArray* dims) {
  int count = 1;
  for (int i = 0; i < dims->size; ++i) {
    count *= dims->data[i];
  }
  return count;
}

// Utility: Clamp integer to [0, 255]
static inline uint8_t clamp255(int v) {
  if (v < 0) return 0;
  if (v > 255) return 255;
  return static_cast<uint8_t>(v);
}

void setup() {
  // Serial init
  Serial.begin(kBaudRate);
  while (!Serial) {
    delay(10);
  }

  // Initialize APDS-9960 Color Sensor
  if (!APDS.begin()) {
    Halt("ERROR: Failed to initialize APDS-9960 sensor.");
  }

  // Initialize TFLite Micro
  tfl_model = tflite::GetModel(model);
  if (tfl_model->version() != TFLITE_SCHEMA_VERSION) {
    Serial.print("ERROR: Model schema ");
    Serial.print(tfl_model->version());
    Serial.print(" not equal to supported schema ");
    Serial.println(TFLITE_SCHEMA_VERSION);
    Halt("Halting.");
  }

  // Create interpreter
  interpreter = new tflite::MicroInterpreter(tfl_model, resolver, tensor_arena, kTensorArenaSize, error_reporter);

  // Allocate tensors
  TfLiteStatus alloc_status = interpreter->AllocateTensors();
  if (alloc_status != kTfLiteOk) {
    Halt("ERROR: AllocateTensors() failed.");
  }

  // Get input and output tensors
  input = interpreter->input(0);
  output = interpreter->output(0);

  // Verify input tensor type and shape
  if (input->type != kTfLiteFloat32) {
    Halt("ERROR: Input tensor type is not float32.");
  }
  if (ElementCount(input->dims) != 3) {
    Halt("ERROR: Input tensor does not have exactly 3 elements.");
  }

  // Verify output tensor type and shape
  if (output->type != kTfLiteUInt8) {
    Halt("ERROR: Output tensor type is not uint8.");
  }
  if (ElementCount(output->dims) != 3) {
    Halt("ERROR: Output tensor does not have exactly 3 elements.");
  }

  // Ready banner
  Serial.println("=======================================");
  Serial.println("RGB Object Classifier (TensorFlow Lite)");
  Serial.println("Device: Arduino Nano 33 BLE Sense");
  Serial.println("Sensor: APDS-9960 RGB Color Sensor (I2C 0x39)");
  Serial.println("Classes: Apple 🍎, Banana 🍌, Orange 🍊");
  Serial.println("Input: [Red, Green, Blue] -> float32 normalized [0..1]");
  Serial.println("Output: 3x uint8 scores -> argmax");
  Serial.println("Baud: 9600, Interval: 200 ms");
  Serial.println("Ready.");
  Serial.println("=======================================");
}

void loop() {
  // Wait for color data to be available
  if (!APDS.colorAvailable()) {
    delay(5);
    return;
  }

  int r_raw = 0, g_raw = 0, b_raw = 0, c_raw = 0;
  APDS.readColor(r_raw, g_raw, b_raw, c_raw);

  // Preprocessing: clamp to [0, 255], convert to float32, normalize to [0, 1]
  uint8_t r8 = clamp255(r_raw);
  uint8_t g8 = clamp255(g_raw);
  uint8_t b8 = clamp255(b_raw);

  input->data.f[0] = static_cast<float>(r8) / 255.0f;
  input->data.f[1] = static_cast<float>(g8) / 255.0f;
  input->data.f[2] = static_cast<float>(b8) / 255.0f;

  // Inference
  TfLiteStatus invoke_status = interpreter->Invoke();
  if (invoke_status != kTfLiteOk) {
    Serial.println("ERROR: Inference failed.");
    delay(kInferenceIntervalMs);
    return;
  }

  // Postprocessing: read 3 uint8 scores and compute argmax
  const uint8_t s0 = output->data.uint8[0];
  const uint8_t s1 = output->data.uint8[1];
  const uint8_t s2 = output->data.uint8[2];

  int max_index = 0;
  uint8_t max_val = s0;
  if (s1 > max_val) { max_val = s1; max_index = 1; }
  if (s2 > max_val) { max_val = s2; max_index = 2; }

  // Map index to class label and emoji
  const char* label = kClassLabels[max_index];
  const char* emoji = kClassEmojis[max_index];

  // Serial output (UTF-8)
  Serial.print("Class: ");
  Serial.print(label);
  Serial.print(" ");
  Serial.println(emoji);

  delay(kInferenceIntervalMs);
}

/*
  Sketch: RGB_Object_Classifier.ino
  Device: Arduino Nano 33 BLE Sense
  Sensor: APDS9960 RGB color sensor (I2C 0x39)
  Libraries:
    - TensorFlow Lite for Microcontrollers
    - Arduino_APDS9960
  Model: model.h (TFLite model as C array)
  Features: Red, Green, Blue
  Classes: Apple, Banana, Orange
*/

#include <Arduino.h>
#include <Arduino_APDS9960.h>
#include "TensorFlowLite.h"
#include "tensorflow/lite/micro/all_ops_resolver.h"
#include "tensorflow/lite/micro/micro_error_reporter.h"
#include "tensorflow/lite/micro/micro_interpreter.h"
#include "tensorflow/lite/schema/schema_generated.h"
#include "tensorflow/lite/version.h"
#include "model.h"

// App/device configuration
static const unsigned long kInvokeIntervalMs = 100; // 10 Hz
static const uint32_t kSerialBaud = 9600;

// Model/configuration specifics
static const int kNumFeatures = 3; // R, G, B
static const int kNumClasses = 3;  // Apple, Banana, Orange
static const float kNormalizeScale = 0.00392156862745098f; // 1/255.0f

// Tensor arena size (bytes)
static const int kTensorArenaSize = 20480;
alignas(16) static uint8_t tensor_arena[kTensorArenaSize];

// TFLM globals
tflite::MicroErrorReporter micro_error_reporter;
tflite::ErrorReporter* error_reporter = nullptr;
const tflite::Model* tfl_model = nullptr;
tflite::AllOpsResolver resolver;
tflite::MicroInterpreter* interpreter = nullptr;
TfLiteTensor* input = nullptr;
TfLiteTensor* output = nullptr;

// Labels and emojis
static const char* kLabels[kNumClasses] = { "Apple", "Banana", "Orange" };
static const char* kEmojis[kNumClasses] = { "🍎", "🍌", "🍊" };

// Timing
static unsigned long last_invoke_ms = 0;

// Utility: clamp to 0..255 and convert to float
static inline float clamp255_to_float_norm(int v) {
  if (v < 0) v = 0;
  if (v > 255) v = 255;
  return v * kNormalizeScale;
}
static inline uint8_t clamp_u8(int v) {
  if (v < 0) return 0;
  if (v > 255) return 255;
  return (uint8_t)v;
}

// Quantization helpers
static inline uint8_t quantize_uint8_from_real(float real, const TfLiteTensor* t) {
  // real_value = scale * (q - zero_point) => q = real/scale + zero_point
  const float inv_scale = (t->params.scale == 0.f) ? 0.f : (1.0f / t->params.scale);
  int q = static_cast<int>(real * inv_scale + t->params.zero_point + 0.5f);
  if (q < 0) q = 0;
  if (q > 255) q = 255;
  return static_cast<uint8_t>(q);
}
static inline int8_t quantize_int8_from_real(float real, const TfLiteTensor* t) {
  const float inv_scale = (t->params.scale == 0.f) ? 0.f : (1.0f / t->params.scale);
  int q = static_cast<int>(real * inv_scale + t->params.zero_point + 0.5f);
  if (q < -128) q = -128;
  if (q > 127) q = 127;
  return static_cast<int8_t>(q);
}

// Argmax over 3 elements for different tensor types
static int argmax_float(const float* v, int n) {
  int idx = 0;
  float best = v[0];
  for (int i = 1; i < n; ++i) {
    if (v[i] > best) { best = v[i]; idx = i; }
  }
  return idx;
}
static int argmax_uint8(const uint8_t* v, int n) {
  int idx = 0;
  uint8_t best = v[0];
  for (int i = 1; i < n; ++i) {
    if (v[i] > best) { best = v[i]; idx = i; }
  }
  return idx;
}
static int argmax_int8(const int8_t* v, int n) {
  int idx = 0;
  int8_t best = v[0];
  for (int i = 1; i < n; ++i) {
    if (v[i] > best) { best = v[i]; idx = i; }
  }
  return idx;
}

void setup() {
  Serial.begin(kSerialBaud);
  while (!Serial) { delay(10); }

  Serial.println("RGB Object Classifier - TensorFlow Lite Micro");
  Serial.println("Initializing APDS9960...");
  if (!APDS.begin()) {
    Serial.println("ERROR: Failed to initialize APDS9960 sensor.");
    while (1) { delay(1000); }
  }
  Serial.println("APDS9960 initialized.");

  // TFLM setup
  error_reporter = &micro_error_reporter;

  // The model must be a tflite flatbuffer embedded via model.h as a C array named 'model'
  tfl_model = tflite::GetModel(model);
  if (tfl_model->version() != TFLITE_SCHEMA_VERSION) {
    error_reporter->Report("Model schema %d not equal to supported %d.", tfl_model->version(), TFLITE_SCHEMA_VERSION);
    while (1) { delay(1000); }
  }

  static tflite::MicroInterpreter static_interpreter(tfl_model, resolver, tensor_arena, kTensorArenaSize, error_reporter);
  interpreter = &static_interpreter;

  if (interpreter->AllocateTensors() != kTfLiteOk) {
    error_reporter->Report("AllocateTensors() failed");
    while (1) { delay(1000); }
  }

  input = interpreter->input(0);
  output = interpreter->output(0);

  // Basic input/output checks
  if (input->dims->size < 2 || input->dims->data[input->dims->size - 1] != kNumFeatures) {
    error_reporter->Report("Unexpected input tensor shape.");
  }
  if (output->dims->size < 2 || output->dims->data[output->dims->size - 1] != kNumClasses) {
    error_reporter->Report("Unexpected output tensor shape.");
  }

  Serial.println("Setup complete. Starting inference loop...");
}

void loop() {
  const unsigned long now = millis();
  if (now - last_invoke_ms < kInvokeIntervalMs) {
    delay(1);
    return;
  }
  last_invoke_ms = now;

  // Wait for new color data
  if (!APDS.colorAvailable()) {
    return;
  }

  int r = 0, g = 0, b = 0, a = 0;
  if (!APDS.readColor(r, g, b, a)) {
    // If read fails, skip this cycle
    return;
  }

  // Preprocess: clamp to [0,255], min-max normalize to [0,1]
  float rf = clamp255_to_float_norm(r);
  float gf = clamp255_to_float_norm(g);
  float bf = clamp255_to_float_norm(b);

  // Write to model input according to input type
  if (input->type == kTfLiteFloat32) {
    float* in = input->data.f;
    in[0] = rf;
    in[1] = gf;
    in[2] = bf;
  } else if (input->type == kTfLiteUInt8) {
    // Quantize from real [0..1] to uint8 using tensor quantization params
    uint8_t* in = input->data.uint8;
    in[0] = quantize_uint8_from_real(rf, input);
    in[1] = quantize_uint8_from_real(gf, input);
    in[2] = quantize_uint8_from_real(bf, input);
  } else if (input->type == kTfLiteInt8) {
    int8_t* in = input->data.int8;
    in[0] = quantize_int8_from_real(rf, input);
    in[1] = quantize_int8_from_real(gf, input);
    in[2] = quantize_int8_from_real(bf, input);
  } else {
    // Unsupported input type
    return;
  }

  // Inference
  if (interpreter->Invoke() != kTfLiteOk) {
    // Invocation failed; skip this cycle
    return;
  }

  // Postprocessing: argmax on output
  int idx = 0;
  if (output->type == kTfLiteFloat32) {
    idx = argmax_float(output->data.f, kNumClasses);
  } else if (output->type == kTfLiteUInt8) {
    idx = argmax_uint8(output->data.uint8, kNumClasses);
  } else if (output->type == kTfLiteInt8) {
    idx = argmax_int8(output->data.int8, kNumClasses);
  } else {
    // Unsupported output type
    return;
  }

  // Emit result in requested format: "{label} {emoji}\n"
  Serial.print(kLabels[idx]);
  Serial.print(" ");
  Serial.println(kEmojis[idx]);
}

#include <Arduino.h>
#include <Arduino_APDS9960.h>
#include <TensorFlowLite.h>
#include "model.h"

// TensorFlow Lite Micro
#include "tensorflow/lite/micro/micro_error_reporter.h"
#include "tensorflow/lite/schema/schema_generated.h"
#include "tensorflow/lite/version.h"
#include "tensorflow/lite/micro/micro_interpreter.h"
#include "tensorflow/lite/micro/micro_mutable_op_resolver.h"

// Labels and emojis
static const char* kLabels[3] = {"Apple", "Banana", "Orange"};
static const char* kEmojis[3] = {"🍎", "🍌", "🍊"};

// TFLM globals
namespace {
  tflite::MicroErrorReporter micro_error_reporter;
  tflite::ErrorReporter* error_reporter = &micro_error_reporter;

  const tflite::Model* tfl_model = nullptr;

  // Adjust count upward if your model requires additional ops
  tflite::MicroMutableOpResolver<20> resolver;

  constexpr int kTensorArenaSize = 16384;
  alignas(16) static uint8_t tensor_arena[kTensorArenaSize];

  tflite::MicroInterpreter* interpreter = nullptr;

  TfLiteTensor* input = nullptr;
  TfLiteTensor* output = nullptr;
}

// Helper: clamp float to [0,1]
static inline float clamp01(float x) {
  if (x < 0.0f) return 0.0f;
  if (x > 1.0f) return 1.0f;
  return x;
}

void setup() {
  // Begin Serial at 9600 baud
  Serial.begin(9600);
  while (!Serial) { delay(10); }

  Serial.println("Starting RGB classifier (TensorFlow Lite Micro)");

  // Initialize APDS-9960 color sensor
  if (!APDS.begin()) {
    Serial.println("Failed to initialize APDS-9960!");
    while (1) { delay(100); }
  }
  Serial.println("APDS-9960 initialized.");

  // Create TFLite model from model.h
  tfl_model = tflite::GetModel(model);
  if (tfl_model->version() != TFLITE_SCHEMA_VERSION) {
    Serial.print("Model schema ");
    Serial.print(tfl_model->version());
    Serial.print(" is not equal to supported schema ");
    Serial.println(TFLITE_SCHEMA_VERSION);
    while (1) { delay(100); }
  }

  // Configure MicroMutableOpResolver and Interpreter
  // Add a common set of ops typically used by small classifiers.
  resolver.AddFullyConnected();
  resolver.AddSoftmax();
  resolver.AddReshape();
  resolver.AddRelu();
  resolver.AddRelu6();
  resolver.AddAdd();
  resolver.AddMul();
  resolver.AddSub();
  resolver.AddLogistic();
  resolver.AddQuantize();
  resolver.AddDequantize();

  static tflite::MicroInterpreter static_interpreter(
    tfl_model, resolver, tensor_arena, kTensorArenaSize, error_reporter);
  interpreter = &static_interpreter;

  // Allocate tensors with tensor arena
  TfLiteStatus alloc_status = interpreter->AllocateTensors();
  if (alloc_status != kTfLiteOk) {
    Serial.println("AllocateTensors() failed");
    while (1) { delay(100); }
  }

  input = interpreter->input(0);
  output = interpreter->output(0);

  // Run one warm-up inference
  if (input && input->type == kTfLiteFloat32 && input->bytes >= (3 * sizeof(float))) {
    input->data.f[0] = 0.0f;
    input->data.f[1] = 0.0f;
    input->data.f[2] = 0.0f;
  }
  if (interpreter->Invoke() != kTfLiteOk) {
    Serial.println("Warm-up inference failed");
    while (1) { delay(100); }
  }

  Serial.println("Setup complete.");
}

void loop() {
  // Read R,G,B from APDS-9960
  int r = 0, g = 0, b = 0;
  if (APDS.colorAvailable()) {
    APDS.readColor(r, g, b);
  } else {
    // If no new data, wait briefly and try again
    delay(5);
    return;
  }

  // Normalize to 0..1 float and write to input tensor (order: R, G, B)
  if (!input || input->type != kTfLiteFloat32) {
    Serial.println("Invalid model input tensor");
    delay(200);
    return;
  }
  const float rf = clamp01((float)r / 255.0f);
  const float gf = clamp01((float)g / 255.0f);
  const float bf = clamp01((float)b / 255.0f);

  input->data.f[0] = rf;
  input->data.f[1] = gf;
  input->data.f[2] = bf;

  // Invoke interpreter
  if (interpreter->Invoke() != kTfLiteOk) {
    Serial.println("Inference failed");
    delay(200);
    return;
  }

  // Read uint8 class index from output tensor
  if (!output || output->type != kTfLiteUInt8 || output->bytes < 1) {
    Serial.println("Invalid model output tensor");
    delay(200);
    return;
  }
  uint8_t idx = output->data.uint8[0];

  // Map index to class label and emoji
  const char* label = (idx < 3) ? kLabels[idx] : "Unknown";
  const char* emoji = (idx < 3) ? kEmojis[idx] : "❓";

  // Print "<label> <emoji>" to Serial
  Serial.print(label);
  Serial.print(" ");
  Serial.println(emoji);

  // Delay 200 ms
  delay(200);
}
